<>
<h1 contentEditable='true'>{`Hello my name is ${name} ${lname}`}</h1>
<img src='https://www.google.com.pk/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2F6%2F63%2FBGH_-_Palais_2.JPG&imgrefurl=https%3A%2F%2Fcommons.wikimedia.org%2Fwiki%2FFile%3ABGH_-_Palais_2.JPG&tbnid=_cq5-mYvqsSJ2M&vet=12ahUKEwj43JHo377tAhVV0IUKHW7qBj4QMygBegUIARCwAQ..i&docid=lHWEsGVkUw0nrM&w=3442&h=2741&q=bgh&hl=en&authuser=0&safe=active&ved=2ahUKEwj43JHo377tAhVV0IUKHW7qBj4QMygBegUIARCwAQ'/>
 </>,
   document.getElementById('root'));
